-- ----------------------------
--  Table structure for `mcustomer`
-- ----------------------------
DROP TABLE IF EXISTS `mcustomer`;
CREATE TABLE `mcustomer` (
  `id_mcustomer` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'running number',
  `mcustomer_code` varchar(50) DEFAULT NULL COMMENT 'รหัสบริษัท',
  `firstname` varchar(150) DEFAULT NULL COMMENT 'ชื่อลูกค้า',
  `lastname` varchar(150) DEFAULT NULL COMMENT 'นามสกุลลูกค้า',
