  `id_mamphur` int(10) DEFAULT NULL COMMENT 'ที่อยู่ แบบบรรทัด#3',
  `id_mdistric` int(10) DEFAULT NULL,
  `idcard_number` varchar(50) DEFAULT NULL COMMENT 'เลขประจำตัวผู้เสียภาษีอากร',
  `email` varchar(50) DEFAULT NULL COMMENT 'อีเมลล์',
  `mobile` varchar(50) DEFAULT NULL COMMENT 'เบอร์มือถือ',
  `fax` varchar(50) DEFAULT NULL COMMENT 'เบอร์แฟกซ์',
  `comment` varchar(4000) DEFAULT NULL COMMENT 'หมายเหตุ',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT 'สถานะรายการ',
  `id_create` int(10) unsigned NOT NULL COMMENT 'ID ผู้สร้าง',
  `dt_create` datetime NOT NULL COMMENT 'datetime สร้างครั้งแรก',
  `id_update` int(10) unsigned NOT NULL COMMENT 'ID ผู้แก้ไขล่าสุด',
  `dt_update` datetime NOT NULL COMMENT 'datetime แก้ไขล่าสุด',
  PRIMARY KEY (`id_mcustomer`),
  KEY `idx_mcustomer_code` (`mcustomer_code`) USING BTREE,
  KEY `idx_mcustomer_name` (`firstname`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=9880 DEFAULT CHARSET=utf8;

